// import React from 'react';
// import CategorizedData from './CategorizedData';

// const MetadataData = () => {
//   return <CategorizedData endpoint="metadata" />;
// };

// export default MetadataData;

import React, { useEffect, useState } from 'react';
import axios from 'axios';

const MetadataData = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/metadata');
        setData(response.data); // Assume the API returns an array
      } catch (err) {
        setError(err.message);
      }
    };

    fetchData();
  }, []);

  if (error) {
    return <p className="text-center text-red-500 font-semibold">Error: {error}</p>;
  }

  if (!data.length) {
    return <p className="text-center text-gray-500 font-semibold">loading....</p>;
  }

  // Extract headers dynamically from the first row of data
  const tableHeaders = Object.keys(data[0]);

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold text-blue-600 mb-6">Metadata Data</h1>

      {/* Table */}
      <div className="overflow-x-auto">
        <table className="table-auto w-full bg-white shadow-md rounded-lg">
          <thead>
            <tr className="bg-blue-500 text-white">
              {tableHeaders.map((header, index) => (
                <th key={index} className="px-4 py-2">{header}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index} className="border-b hover:bg-gray-100">
                {tableHeaders.map((header, index) => (
                  <td key={index} className="px-4 py-2">{item[header] || 'N/A'}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default MetadataData;
